import React, { Component } from 'react'
import QualityQuestion from './Questions/QualityQuestion.js';

export default class Quiz extends Component {
  constructor(props) {
    super(props);


  }
  generateQuestion(difficulty) {
    // 718 items as of now
    if(difficulty == "easy") {
      fetch('https://www.platynowy-bog.com.pl/api/items/44')
        .then(response => response.json())
        .then(data => this.setState({ totalReactPackages: data.total }));
    }
  }
  render() {
    return (
      <div>
        <QualityQuestion itemName="example"></QualityQuestion>
      </div>
    )
  }
}
